pub enum Cache {

    /// No preloading at all, filesystem::open will always panic.
    No,

    /// Load /index.txt first, and cache all the files specified.
    /// Game will not start until all the files will be cached
    Index,

    /// Same as Index, but with the files list instead of index.txt
    List(Vec<&'static str>),

    /// Tar archive contents, usually from include_bytes!
    Tar(&'static [u8]),
}

pub enum Loading {

    /// No progressbar at all, no html special requirements
    No,

    /// Will look for some specific html elements and show default progress bar
    Embedded,
}

pub enum TextureWrap {

    /// Samples at coord x + 1 map to coord x.
    Repeat,

    /// Samples at coord x + 1 map to coord 1 - x.
    Mirror,

    /// Samples at coord x + 1 map to coord 1.
    Clamp,

    /// Same as Mirror, but only for one repetition.
    MirrorClamp,
}

pub enum TextureAccess {

    /// Used as read-only from GPU
    Static,

    /// Can be written to from GPU
    RenderTarget,
}

pub enum ShaderError {
    CompilationError {
        shader_type: ShaderType,
        error_message: String,
    },
    LinkError(String),

    /// Shader strings should never contains \00 in the middle
    FFINulError(std::ffi::NulError),
}

pub enum PassAction {
    Nothing,
    Clear {
        color: Option<(f32, f32, f32, f32)>,
        depth: Option<f32>,
        stencil: Option<i32>,
    },
}

pub enum Equation {

    /// Adds source and destination. Source and destination are multiplied
    /// by blending parameters before addition.
    Add,

    /// Subtracts destination from source. Source and destination are
    /// multiplied by blending parameters before subtraction.
    Subtract,

    /// Subtracts source from destination. Source and destination are
    /// multiplied by blending parameters before subtraction.
    ReverseSubtract,
}

pub enum BlendValue {
    SourceColor,
    SourceAlpha,
    DestinationColor,
    DestinationAlpha,
}

